import React from 'react';
import WareHouseMaterial from "../pages/WareHouseMaterial";
import HeaderComponent from "../component/HeaderComponent";

const ToMaterial = () => {
    return (
        <div>
            <HeaderComponent/>

            <WareHouseMaterial/>
        </div>
    );
};

export default ToMaterial;
